"use strict";
var $ = function(id) { return document.getElementById(id); };

//global stop watch timer variable and elapsed time object
var stopwatchTimer;
var elapsedMinutes = 0;
var elapsedSeconds = 0;
var elapsedMilliseconds = 0;
var elapsedHours=0;

var displayCurrentTime = function() 
{
    var date=new Date();
    var seconds=date.getSeconds();
    var minuites=date.getMinutes();
    var hours=date.getHours();
    var ampms='AM';
    if(hours>12)
    {
        hours=hours-12;
    }
    if(hours>=12)
    {
        ampms='PM'
    }
    if(minuites<10)
    {
        minuites="0"+minuites;
    }
    if(seconds<10)
    {
        seconds="0"+seconds;
    }
    $("hours").innerText=hours;
    $("minutes").innerText=minuites;
    $("seconds").innerText=seconds;
    $("ampm").innerText=ampms;
};

var padSingleDigit = function(num) {
	if (num < 10) {	return "0" + num; }
	else { return num; }
};

var tickStopwatch = function() {    
    //debugger;
    // increment milliseconds by 10 milliseconds
    elapsedMilliseconds=elapsedMilliseconds+10;
    // if milliseconds total 1000, increment seconds by one and reset milliseconds to zero
    if(elapsedMilliseconds >=1000)
    {
        elapsedMilliseconds =0;
        elapsedSeconds++;
    }
    // if seconds total 60, increment minutes by one and reset seconds to zero
    if(elapsedSeconds == 60)
    {
        elapsedSeconds = 0;
        elapsedMinutes++;
    }
    if(elapsedMinutes == 60)
    {
        elapsedMinutes=0;
        elapsedHours++;

    }
    $("s_ms").innerText=padSingleDigit(elapsedMilliseconds);
    $("s_seconds").innerText=padSingleDigit(elapsedSeconds);
    $("s_minutes").innerText=padSingleDigit(elapsedMinutes);
    $("s_hours").innerHTML=padSingleDigit(elapsedHours);
    //display new stopwatch time
    var timer=document.getElementById("appt");
    if(timer.value == elapsedMinutes)
    {
        if(stopwatchTimer != null)
        {
            clearInterval(stopwatchTimer);
            stopStopwatch=null;
            setExp();
            explosive();
        }
    }
};

// event handler functions
var startStopwatch = function(evt) {
    debugger;
    // prevent default action of link
    evt.preventDefault();
    // do first tick of stop watch and then set interval timer to tick 
    // stop watch every 10 milliseconds. Store timer object in stopwatchTimer 
    // variable so next two functions can stop timer.
    
    var timer=document.getElementById("appt");
    timer.setAttribute('disabled','');
    if(timer.value != "")
    {
        $("message").innerText="";
        stopwatchTimer=setInterval(tickStopwatch,10);
    }
    else
    {
        $("message").innerText="Set Timer ";
    }
    
};

var stopStopwatch = function(evt) {
    // prevent default action of link
    evt.preventDefault();
        if(stopwatchTimer != null)
        {
            clearInterval(stopwatchTimer);
            stopStopwatch=null;
        }
    // stop timer
    
};

var resetStopwatch = function(evt) {
    // prevent default action of link
    evt.preventDefault();
    // stop timer
    document.getElementById("appt").removeAttribute('disabled');
    document.getElementById("appt").innerText="";
    if(stopwatchTimer != null)
    {
        clearInterval(stopwatchTimer);
        stopStopwatch=null;
    }
    elapsedMilliseconds=0;
    elapsedMinutes=0;
    elapsedSeconds=0;
    $("s_ms").innerText=padSingleDigit(elapsedMilliseconds);
    $("s_seconds").innerText=padSingleDigit(elapsedSeconds);
    $("s_minutes").innerText=padSingleDigit(elapsedMinutes);
    // reset elapsed variables and clear stopwatch display
    
};

window.onload = function() {debugger;
    // set initial clock display and then set interval timer to display
    // new time every second. Don't store timer object because it 
    // won't be needed - clock will just run.
    displayCurrentTime();
    setInterval(displayCurrentTime, 1000);
    
    // set up stopwatch event handlers
    $('start').onclick=startStopwatch;
    $('stop').onclick=stopStopwatch;
    $('reset').onclick=resetStopwatch;

};
